import Header from './Header';
import Sidebar from './Sidebar';
import MainArea from './MainArea';

export default function Home({ data: { user } }) {


    return (
        <>
            <Header />
            <Container style={{ marginTop: 15 }}>
                <Columns>
                    <Column isSize={3}>
                        <Sidebar />
                    </Column>
                    <MainArea profile={user} />
                </Columns>
            </Container>
        </>
    )
}
